import * as React from "react";
import { styled } from "@mui/material/styles";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell, { tableCellClasses } from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Input from "@mui/material/Input";
import Paper from "@mui/material/Paper";
import DeleteForeverIcon from "@mui/icons-material/DeleteForever";

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  "&:last-child td, &:last-child th": {
    border: 0,
  },
}));

export default function SelectedCoinsTable({
  coins,
  deleteCoin,
  handleQtChangeTable,
}) {
  return (
    <TableContainer component={Paper}>
      <Table aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Assets</StyledTableCell>
            <StyledTableCell>Symbol</StyledTableCell>
            <StyledTableCell>Current Price</StyledTableCell>
            <StyledTableCell>Amount</StyledTableCell>
            {deleteCoin != null ? (
              <StyledTableCell align="right">Options</StyledTableCell>
            ) :
            <td/>}
          </TableRow>
        </TableHead>
        <TableBody>
          {coins.map((coin, index) => (
            <StyledTableRow key={coin.name}>
              <StyledTableCell component="th" scope="row">
                {coin.name}
              </StyledTableCell>
              <StyledTableCell component="th" scope="row">
                {coin.symbol}
              </StyledTableCell>
              <StyledTableCell component="th" scope="row">
                {coin.currentPrice}
              </StyledTableCell>
              <StyledTableCell component="th" scope="row">
                {handleQtChangeTable != null ? (
                  <Input
                    type="number"
                    defaultValue={coin.quantity}
                    onChange={(e) => handleQtChangeTable(e, index)}
                  />
                ) : (
                  coin.quantity
                )}
              </StyledTableCell>
              {deleteCoin != null ? (
                <StyledTableCell component="th" scope="row">
                  <DeleteForeverIcon onClick={() => deleteCoin(index)} />
                </StyledTableCell>
              ) : 
              <td/>}
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
